%%%%----- FUNCION PRINCIPAL ALGORITMO GENETICO

function [mascaracontorno3D20, desplazamientos] = ga(n_cromosomas, cromosomas, tam_cromosoma, grados_num, dimensiones, dimCT, origen, estudio3D_CT, mascaracontorno3D, isocentro)
for i = 1:n_cromosomas
    i
    orden_de_giro = transpose(cromosomas(1:10,:,i));
    cas = orden_de_giro(1)*(2^9) + (orden_de_giro(2))*(2^8) + (orden_de_giro(3))*(2^7) + (orden_de_giro(4))*(2^6) + (orden_de_giro(5))*(2^5) + (orden_de_giro(6))*(2^4) + (orden_de_giro(7))*(2^3) + (orden_de_giro(8))*(2^2) + (orden_de_giro(9))*(2^1) + (orden_de_giro(10))*(2^0);
    if cas>720
        caso = cas-720;
    else
        caso = cas;
    end
    caso
    % Tomar el orden de las combinaciones
    % [0 0 0 0 0 1] -> 01: xRyYzP
    % [0 0 0 0 1 0] -> 02: xRyPzY
    % [0 0 0 0 1 1] -> 03: xYyRzP
    % [0 0 0 1 0 0] -> 04: xYyPzR
    % [0 0 0 1 0 1] -> 05: xPyRzY
    % [0 0 0 1 1 0] -> 06: xPyYzR
    % 007: xRzYyP
    % 008: xRzPyY
    % 009: xYzRyP
    % 010: 
    
    
    %tam_cromosoma [17] - 5 = posicion 12 es roll
    %tam_cromosoma [17] - 4 = posicion 13 es yaw
    %tam_cromosoma [17] - 3 = posicion 14 es pitch
    %tam_cromosoma [17] - 2 = posicion 15 es x
    %tam_cromosoma [17] - 1 = posicion 16 es y
    %tam_cromosoma [17]     = posicion 17 es z
    
    
    switch caso
        case 1
            %AQUI INICIA LA TRASLACION EN X
            if cromosomas(tam_cromosoma-2,1,i) == 0
                degree = -grados_num;
            else
                degree = grados_num;
            end
            [des, mascara] = traslacion_x(dimensiones, dimCT, origen, estudio3D_CT, degree, mascaracontorno3D, isocentro);
            mascaracontorno3D20 = mascara;

            %AQUI INICIA LA ROTACION EN ROLL
            if cromosomas(tam_cromosoma-5,1,i) == 0
                degree = -grados_num;
            else
                degree = grados_num;
            end
            [des, mascara] = rotation_roll(dimensiones, dimCT, origen, estudio3D_CT, degree, mascaracontorno3D20, isocentro);
            mascaracontorno3D20 = mascara;
        
            %AQUI INICIA LA TRASLACION EN y
